decision:
Позов ОСОБА_1 задовольнити.
Визнати за ОСОБА_1 право на спадщину, як спадкоємця першої черги за законом після смерті матері ОСОБА_2, яка померла ІНФОРМАЦІЯ_1 в селі Голубече Крижопільського району Вінницької області, а саме на:
- цілий житловий будинок з господарськими будівлями, який знаходиться по АДРЕСА_1 до складу якого входять Житловий будинок - «А» загальною площею 67,8 кв.м, житловою площею 36,5 кв.м., веранда - «а», ганок - «а1», літня кухня - «а2», сарай - «Б», сарай - «В», сарай «Г», огорожа - «1-3»;

Позовні вимоги ОСОБА_1 до ОСОБА_2 про визнання права власності на майно в порядку спадкування - задовольнити.
Визнати за ОСОБА_1 (ІНФОРМАЦІЯ_1, народжений в м. Донецьку Донецької області, зареєстрований за адресою АДРЕСА_1, реєстраційний номер облікової картки платника податків НОМЕР_1) право власності в порядку спадкування після смерті ОСОБА_4, який помер ІНФОРМАЦІЯ_5 в м. Донецьку Донецької області, на таке майно:
на ? частину житлового будинку з надвірними будівлями, розташованого за адресою АДРЕСА_2;

Заяву задоволити.
Встановити факт належності ОСОБА_2, ІНФОРМАЦІЯ_1, яка померла ІНФОРМАЦІЯ_2 у с. Станківці Миколаївського району Львівської області правовстановлюючих документів:
- заповіту, посвідченого 09.08.2001р. Хомусяк Любов'ю Василівною, секретарем виконавчого комітету Станківецької сільської ради Миколаївського району Львівської області, зареєстрованого в реєстрі за № 98;

Заяву задоволити.
Встановити факт належності ОСОБА_2, ІНФОРМАЦІЯ_1, яка померла ІНФОРМАЦІЯ_2 у с. Станківці Миколаївського району Львівської області правовстановлюючих документів:
- заповіту, посвідченого 09.08.2001р. Хомусяк Любов'ю Василівною, секретарем виконавчого комітету Станківецької сільської ради Миколаївського району Львівської області, зареєстрованого в реєстрі за № 98;

Позовну заяву ОСОБА_1 до ОСОБА_2 про стягнення боргу та визнання права власності - задовольнити частково.
Визнати за ОСОБА_1 право власності на комплекс сільськогосподарських будівель та споруд за адресою: Донецька область, с. Водяне, вул.. Челюскінців, буд. 5 а з наступними технічними показниками:
- будівля вагової в складі: надземна частина «А-1», підземна частина «Ап» загальною площею 169,5 кв.м., основною площею 53,1 кв.м., вхід в підземну частину «ав», ганок «аг»;
